" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Distending media for hysteroscopy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Category",
"      </td>",
"      <td class=\"subtitle1\">",
"       Medium",
"      </td>",
"      <td class=\"subtitle1\">",
"       Hysteroscopic procedure",
"      </td>",
"      <td class=\"subtitle1\">",
"       Biochemical properties",
"      </td>",
"      <td class=\"subtitle1\">",
"       Complications or Adverse effects",
"      </td>",
"      <td class=\"subtitle1\">",
"       Safety measures*&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Gaseous",
"      </td>",
"      <td>",
"       Carbon dioxide",
"      </td>",
"      <td>",
"       Diagnostic",
"      </td>",
"      <td>",
"       Colorless gas",
"      </td>",
"      <td>",
"       <p>",
"        Gas embolism",
"       </p>",
"       <p>",
"        Shoulder pain",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Use hysteroscopic insufflator",
"       </p>",
"       <p>",
"        Safety thresholds:",
"       </p>",
"       <p>",
"        Flow &lt;100 mL/min",
"       </p>",
"       <p>",
"        Intrauterine pressure &lt;100 mmHg",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Electrolyte fluid",
"      </td>",
"      <td>",
"       <p>",
"        Saline",
"       </p>",
"       <p>",
"        0.9 percent",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Diagnostic",
"       </p>",
"       <p>",
"        Operative: without electrocautery",
"        <strong>",
"         OR",
"        </strong>",
"        with bipolar electrocautery",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Water and sodium chloride",
"       </p>",
"       <p>",
"        Istotonic",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Thermal burn if used with monopolar electrocautery",
"       </p>",
"       <p>",
"        Volume overload",
"       </p>",
"      </td>",
"      <td rowspan=\"2\">",
"       <p>",
"        Fluid deficit thresholds:",
"       </p>",
"       <p>",
"        750 mL: Plan completion of procedure",
"       </p>",
"       <p>",
"        2500 mL: Stop procedure (or earlier in patients who are elderly or have comorbidities)",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Lactated Ringer's solution",
"      </td>",
"      <td>",
"       <p>",
"        Diagnostic",
"       </p>",
"       <p>",
"        Operative: without electrocautery",
"        <strong>",
"         OR",
"        </strong>",
"        with bipolar electrocautery",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Water and sodium chloride, lacatate, potassium, calcium",
"       </p>",
"       <p>",
"        Isotonic",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Thermal burn if used with monopolar electrocautery",
"       </p>",
"       <p>",
"        Volume overload",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Electrolyte-poor fluids",
"      </td>",
"      <td>",
"       <p>",
"        Mannitol",
"       </p>",
"       <p>",
"        5 percent",
"       </p>",
"      </td>",
"      <td>",
"       Operative: monopolar electrocautery",
"      </td>",
"      <td>",
"       <p>",
"        Six-carbon sugar",
"       </p>",
"       <p>",
"        Cleared by kidneys; acts as its own diuretic",
"       </p>",
"       <p>",
"        Elimination half-life: &ge;100 min&Delta;",
"       </p>",
"       <p>",
"        Isoosmolar",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Volume overload",
"       </p>",
"       <p>",
"        Hyponatremia",
"       </p>",
"      </td>",
"      <td rowspan=\"3\">",
"       <p>",
"        Fluid deficit thresholds:",
"       </p>",
"       <p>",
"        750 mL: Plan completion of procedure",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Stop procedure in patients who are elderly or have comorbidities",
"       </p>",
"       <p>",
"        1000 mL: Stop procedure",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <p>",
"        Sorbitol",
"       </p>",
"       <p>",
"        3 percent",
"       </p>",
"      </td>",
"      <td>",
"       Operative: monopolar electrocautery",
"      </td>",
"      <td>",
"       <p>",
"        Six-carbon sugar",
"       </p>",
"       <p>",
"        Metabolized in the liver to fructose and glucose",
"       </p>",
"       <p>",
"        Elimination half-life: &ge;33 min&Delta;",
"       </p>",
"       <p>",
"        Hypoosmolar",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Volume overload",
"       </p>",
"       <p>",
"        Hyponatremia",
"       </p>",
"       <p>",
"        Hypoosmolality",
"       </p>",
"       <p>",
"        Hyperglycemia",
"       </p>",
"       <p>",
"        Peritonitis&loz;",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <p>",
"        Glycine",
"       </p>",
"       <p>",
"        1.5 percent",
"       </p>",
"      </td>",
"      <td>",
"       Operative: monopolar electrocautery",
"      </td>",
"      <td>",
"       <p>",
"        Amino acid",
"       </p>",
"       <p>",
"        Metabolized into serine and ammonia",
"       </p>",
"       <p>",
"        Elimination half-life: &ge;40 min&Delta;",
"       </p>",
"       <p>",
"        Hypoosmolar",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Volume overload",
"       </p>",
"       <p>",
"        Hyponatremia",
"       </p>",
"       <p>",
"        Hypoosmolality",
"       </p>",
"       <p>",
"        Hyperammonemia",
"       </p>",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
