"     <br>",
"      &bull; Loffer, FD, Bradley, LD, Brill, AI, et al. Hysteroscopic fluid monitoring guidelines. The ad hoc committee on hysteroscopic training guidelines of the American Association of Gynecologic Laparoscopists. J Am Assoc Gynecol Laparosc 2000; 7:167.",
"      <br>",
"       &Delta; Hahn, RG. Br J Anaesth 2006; 96:8.",
"       <br>",
"        &loz; Phillips, AJ. Obstet Gynecol 2003; 102:1148.",
